import axios from "axios";
import { useEffect } from "react";
import profileIcon from "../resources/user.png"
//import "../styles/profile.css"


var user;

function Profile(){

    // useEffect(()=>{
    //     getUser();
    // },[]);

    return (
        <div>
            <form>
                <h1>X</h1>
                <img src={(user.img) ? user.image: profileIcon} alt="userimage" />
                <input type="text" name="userName" value={user.username} />
                <input type="email" name="userEmail" value={user.email} />
                <button>Edit</button>
            </form>
        </div>
    )
}


function getUser(){
    const uID = localStorage.getItem("id");
    axios.post("http://www.localhost:5000/getUser",{uID:uID}).then((res)=>{
        user = res.data;
        console.log(user)
    })
}

export default Profile;
